import React from "react";
import { useSelector } from "react-redux";

export const Home = (props) => {
  const slots = useSelector((state) => state.selectedPlan.plan);
  return (
    <div>
      {slots.length &&
        slots.map((slot) => {
          return <h1>{slot.startTime}</h1>;
        })}
    </div>
  );
};
